// @ts-nocheck
import React, { ReactNode, HTMLAttributes } from 'react';
import { createComponent } from '../lib';
import type { JSX } from '@vime/core/dist/types';

import { 
  VmClickToPlay 
} from '@vime/core';

import { define } from '../lib';


define('vm-click-to-play', VmClickToPlay);


export interface ClickToPlayProps extends JSX.VmClickToPlay, HTMLAttributes<HTMLVmClickToPlayElement> {
  children?: ReactNode | ReactNode[]
};

export default createComponent<HTMLVmClickToPlayElement, ClickToPlayProps>(
  'vm-click-to-play',
  new Set(['useOnMobile','paused','isVideoView','isMobile']),
);
